import React from 'react';
import { Typography, Card, CardContent, CardMedia, Grid, Container } from '@mui/material';
import backgroundImage from '../assets/layer5.jpg'; 
import defaultPersonImage from '../assets/people/default.jpg'; 
import aishwaryaImg from '../assets/people/aishwarya.jpg' ; 
import ramImg from  '../assets/people/ram.png'; 

function People() {
  const currentMembers = [
    { name: "Aishwarya Ganesan", role: "Assistant Professor", image: aishwaryaImg },
    { name: "Ram Alagappan", role: "Assistant Professor", image: ramImg},
    { name: "Xuhao Luo", role: "PhD student", image: defaultPersonImage },
    { name: "Henry Zhu", role: "PhD student", image: defaultPersonImage },
    { name: "Shreesha G Bhat", role: "PhD student", image: defaultPersonImage },
    { name: "Jiyu Hu", role: "PhD student", image: defaultPersonImage },
    { name: "Kiran Hombal", role: "PhD student", image: defaultPersonImage },
    { name: "Chaitanya Bhandari", role: "MS student", image: defaultPersonImage },
    { name: "Ramya Bygari", role: "MS student", image: defaultPersonImage },
    { name: "Neil Kaushikkar", role: "undergrad thesis", image: defaultPersonImage }
  ];

  const alumni = [
    { name: "Wenqing Luo", role: "MS Thesis; First Employment: Apple", image: defaultPersonImage },
    { name: "Shubhi Jain", role: "MCS student", image: defaultPersonImage },
    { name: "Abhi Wangoo", role: "undergrad", image: defaultPersonImage },
    { name: "Akul Gupta", role: "undergrad", image: defaultPersonImage },
    { name: "Amaan Khan", role: "undergrad", image: defaultPersonImage }
  ];

  return (
    <Container sx={{
      mt: 4,
      backgroundImage: `url(${backgroundImage})`,
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      backgroundRepeat: 'no-repeat',
      borderRadius: '16px',
      padding: 3,
      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.5)',
      backgroundColor: 'rgba(0, 0, 0, 0.5)', 
    }}>
      <Typography variant="h4" sx={{ mb: 4, color: 'white', fontWeight: 'bold', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)' }}>
        People
      </Typography>
      <Typography variant="h5" sx={{ mt: 2, mb: 2, color: 'white', fontWeight: 'bold', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)' }}>
        Current Members
      </Typography>
      <Grid container spacing={2}>
        {currentMembers.map((person, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Card sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              backgroundColor: 'rgba(255, 255, 255, 0.9)',
              borderRadius: '8px',
            }}>
              <CardMedia
                component="img"
                image={person.image}
                alt={person.name}
                sx={{
                  width: '100%', 
                  height: "60%", 
                  objectFit: 'cover' 
                }}
              />
              <CardContent>
                <Typography variant="h6" sx={{ fontWeight: 'bold' }}>{person.name}</Typography>
                <Typography variant="body2">{person.role}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
      <Typography variant="h5" sx={{ mt: 4, mb: 2, color: 'white', fontWeight: 'bold', textShadow: '2px 2px 4px rgba(0, 0, 0, 0.5)' }}>
        Alumni
      </Typography>
      <Grid container spacing={2}>
        {alumni.map((alum, index) => (
          <Grid item xs={12} sm={6} md={4} key={index}>
            <Card sx={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              backgroundColor: 'rgba(255, 255, 255, 0.9)',
              borderRadius: '8px',
            }}>
              <CardMedia
                component="img"
                image={alum.image}
                alt={alum.name}
                sx={{
                  width: '100%', 
                  height: "60%", 
                  objectFit: 'cover' 
                }}
              />
              <CardContent>
                <Typography variant="h6" sx={{ fontWeight: 'bold' }}>{alum.name}</Typography>
                <Typography variant="body2">{alum.role}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}

export default People;
